  false,\n\t\"url\": null,\n\t\"notes\": \"This Environmental Assessment is for the
  proposed action by U.S. Fish and Wildlife Service to increase waterfowl nesting
  success by conducting intensive predator management at selected locations within
  the Devils Lake Wetland Management District in northeast North Dakota. The proposed
  action is to conduct intensive predator control by trapping on islands and fenced
  peninsulas, Kellys Slough Project Area and Waterfowl Production Areas (WPA) and
  National Wildlife Refuge (NWR) and on Lake Alice NWR. Predators would be removed
  from these selected areas by Service personnel or professional trappers from March
  15 to July 15, prior to and during the waterfowl nesting season. Specific predators
  targeted for removal are red fox, raccoon, skunk, and mink, Nest success studies
  will continue to be conducted to determine the effectiveness of the predator management.\",\n\t\"owner_org\":
